import Header from './CommonComponents/Header';
import Footer from './CommonComponents/Footer';
import Navbar from './CommonComponents/Navbar';



class AdminHomePage extends Component {




    constructor(props) {
        super(props)

        this.state = {
            username: '',
            password: '',
            error: false,
        }

        this.onSubmit = this.onSubmit.bind(this);
        this.handleChange = this.handleChange.bind(this);
    }



    render() {
        return (
            <div>
                <Header />
                <div className="container-fluid">
                    <div className="row">
                        <div className="col-md-2 navbar-div">
                            <Navbar />
                        </div>
                        <div className="col-md-10 content-div">

                            <div className="container-fluid">
                                <div className="row">
                                    <div className="col-md-3 admin-home-content-div col1">
                                        <h3 className="admin-home-content-div-txt">asd</h3>
                                        <p className="admin-home-content-div-number"></p>
                                    </div>

                                    <div className="col-md-3 admin-home-content-div col2">
                                        <h3 className="admin-home-content-div-txt">asd</h3>
                                        <p className="admin-home-content-div-number"></p>
                                    </div>

                                    <div className="col-md-3 admin-home-content-div col3">
                                        <h3 className="admin-home-content-div-txt">asd</h3>
                                        <p className="admin-home-content-div-number"></p>
                                    </div>

                                </div>
                            </div>

                        </div>
                    </div>
                </div>
                <Footer />
            </div>
        );
    }
}

export default AdminHomePage;
